INSERT INTO `conteudos` (`id`, `titulo`, `conteudo`, `createdAt`, `updatedAt`, `status`, `path`, `tipo_noticia_img`, `tipo`) VALUES
(1, 'Biografia', '<p style="text-align: justify;">Rafael Oliveira Claros, nasceu no dia 15 de junho de 1982 em Porto Velho/RO. Casado, pai de 03 filhos, advogado e empres&aacute;rio do ramo de presta&ccedil;&atilde;o de servi&ccedil;os de m&atilde;o de obra e consultoria.<br><br>Estudou no Centro Educacional Dr&ordm; Grangeiro at&eacute; a 8&ordf; s&eacute;rie. Concluiu sua educa&ccedil;&atilde;o no Col&eacute;gio Dom Bosco em Porto Velho.<br><br>Trabalha nas empresas da fam&iacute;lia desde os 10 anos de idade (limpeza, vigil&acirc;ncia, constru&ccedil;&atilde;o, venda de a&ccedil;&uacute;car, entre outros). Visitava todas as reparti&ccedil;&otilde;es p&uacute;blicas desde crian&ccedil;a acompanhando o pai, com isso foi desenvolvendo conhecimento de gerenciamento e conhecendo como funcionava toda a &aacute;rea p&uacute;blica do Estado de Rond&ocirc;nia. Tanto secret&aacute;rios, presidentes de institui&ccedil;&otilde;es, gerentes e servidores p&uacute;blicos o conhecem.<br><br>Frequentou faculdade de direito em Bras&iacute;lia, momento no qual estagiou no Centro de prote&ccedil;&atilde;o aos meninos e meninas de rua do Distrito Federal. Trabalhou na C&acirc;mara dos Deputados Federais, onde ficou respons&aacute;vel pela elabora&ccedil;&atilde;o das emendas ao Or&ccedil;amento.<br><br>No 5&ordm; semestre da faculdade, foi convidado a participar de sociedade em um escrit&oacute;rio de advocacia em Bras&iacute;lia, no qual levava as demandas jur&iacute;dicas de Rond&ocirc;nia e acompanhava o andamento nos tribunais superiores em Bras&iacute;lia.<br><br>Ao retornar pra Rond&ocirc;nia, passou a advogar para sindicatos e associa&ccedil;&otilde;es nas &aacute;reas tribut&aacute;ria e ambiental, visando a redu&ccedil;&atilde;o de impostos que traziam benef&iacute;cios aos consumidores do estado de Rond&ocirc;nia, fazendo com que mesmo com o frete os produtos do estado tivessem pre&ccedil;os semelhantes ao dos estados onde s&atilde;o produzidos.<br><br>Foi Secret&aacute;rio de Esportes do Munic&iacute;pio de Porto Velho, onde de maneira diferenciada passou a ouvir as demandas da comunidade, investindo no esporte de acordo com os anseios da popula&ccedil;&atilde;o de cada bairro da capital. Encontrou a secret&aacute;ria com apenas 05 escolinhas ativas. Ap&oacute;s conversar com associa&ccedil;&otilde;es de bairros e com a pr&oacute;pria popula&ccedil;&atilde;o, ouvindo a necessidade de cada bairro e distrito de Porto Velho, elevou para 80 escolinhas esportivas em parceria com a comunidade, onde a Prefeitura entregava o material e os professores dos bairros treinavam as crian&ccedil;as e eram supervisionados pelos professores do munic&iacute;pio.<br><br>Atualmente advoga na &aacute;rea ambiental e tribut&aacute;ria buscando apoio aos empreendedores sejam eles do campo ou da cidade. Na &aacute;rea tribut&aacute;ria, busca a desonera&ccedil;&atilde;o da carga tribut&aacute;ria e desburocratiza&ccedil;&atilde;o do sistema tribut&aacute;rio.<br><br>Na &aacute;rea ambiental busca o entendimento entre os produtores e os &oacute;rg&atilde;os de controle ambiental para possibilitar maior produ&ccedil;&atilde;o sem aumentar a &aacute;rea desmatada ou sem riscos de danos ao meio ambiente.<br><br>Rafael Claros advoga ainda em processos contra as usinas hidrel&eacute;tricas do Rio Madeira buscando que os ribeirinhos e produtores rurais recebam as indeniza&ccedil;&otilde;es pelos preju&iacute;zos sofridos com a constru&ccedil;&atilde;o das usinas.</p>', '2018-08-06 13:11:15', '2018-08-06 23:14:10', 'ativo', NULL, NULL, 'estatico'),
