(3, 'Empregos e Terceirização', '<p>Vamos priorizar a cria&ccedil;&atilde;o de mais EMPREGOS atrav&eacute;s da TERCEIRIZA&Ccedil;&Atilde;O de SERVI&Ccedil;OS B&Aacute;SICOS em Rond&ocirc;nia.</p>\r\n', '2018-08-06 13:11:55', '2018-09-10 19:10:03', 'ativo', NULL, NULL, 'estatico'),
(4, 'Regularização Fundiária', '<p>Fortalecer a IMPLEMENTA&Ccedil;&Atilde;O TECNOL&Oacute;GICA de todo setor produtivo e do AGRONEG&Oacute;CIO em Rond&ocirc;nia.</p>\r\n', '2018-08-06 13:12:19', '2018-09-10 19:12:12', 'ativo', NULL, NULL, 'estatico'),
(5, 'Esporte e Cultura', '<p>Potencializar investimento de recursos atrav&eacute;s de PROJETOS para o ESPORTE CULTURA e turismo do Estado.</p>\r\n', '2018-08-06 13:12:39', '2018-09-10 19:13:22', 'ativo', NULL, NULL, 'estatico'),
(6, 'Capacitação de 1° Emprego', '<p>CAPACITAR profissionaiis para o novo mercado externo e criar novas vagas para MENOR APRENDIZ e 1&deg; EMPREGO.</p>\r\n', '2018-08-06 13:12:59', '2018-09-10 19:10:58', 'ativo', NULL, NULL, 'estatico'),
(7, 'Tecnologia no Agronegócio', '<p>Fortalecer a IMPLEMENTA&Ccedil;&Atilde;O TECNOL&Oacute;GICA de todo setor produtivo e do AGRONEG&Oacute;CIO em Rond&otilde;nia.</p>\r\n', '2018-08-06 13:13:24', '2018-09-10 19:16:46', 'ativo', NULL, NULL, 'estatico'),
