(14, 'Rafael Claros buscou ouvir lideranças em Porto Velho', '<p>Rafael Claros buscou ouvir lideran&ccedil;as em Porto Velho</p>\r\n\r\n<p>Seja como candidato a vereador, governador, deputado estadual ou secret&aacute;rio, Rafael Claros sem buscou ouvir lideran&ccedil;as e comunidade para buscar o melhor caminho. Em 2015, quando assumiu a miss&atilde;o de responder pela Secretaria Municipal de Esporte e Lazer de Porto Velho, Rafael, ouviu lideran&ccedil;as de bairros, desportistas, representantes de ligas desportivas e de clubes de m&atilde;es, dentre outros. O principal objetivo era ouvir sugest&otilde;es, opini&otilde;es e discutir propostas para fomentar e fortalecer o esporte em todo Munic&iacute;pio.</p>\r\n\r\n<p>&ldquo;Em qualquer cargo p&uacute;blico, estamos representando toda uma cidade, um estado. O correto &eacute; ouvir a popula&ccedil;&atilde;o e buscar o melhor caminho para desenvolver projetos que correspondem as necessidades de todos. &Eacute; uma obriga&ccedil;&atilde;o ouvir as opini&otilde;es, sugest&otilde;es e receber propostas de quem realmente sofre com o problema e buscar solucionar&rdquo;, refor&ccedil;ou Rafael Claros.</p>\r\n\r\n<p>Saiba mais:<br />\r\nhttps://maisro.com.br/semes-ouve-liderancas-com-objetivo-de-fomentar-e-fortalecer-o-esporte-na-capital/<br />\r\n&nbsp;</p>\r\n', '2018-08-11 00:40:27', '2018-08-28 12:50:40', 'ativo', '5fee47f9528a1a2570cfc131f008a3b5-1535460640530.jpg', 'destaque', 'noticia'),
(15, 'ONGs e Associações', '<p>Consolidar o 3&deg; setor atrav&eacute;s de capacita&ccedil;&otilde;es das ONGs, ASSOCIA&Ccedil;&Otilde;ES, CONSELHOS, ENTIDADES e IGREJAS.</p>\r\n', '2018-08-22 00:04:20', '2018-09-10 19:14:37', 'ativo', NULL, NULL, 'estatico');
